INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2, 0, 8, 91002, "ペコリーヌとの出会い", 40, 7, 10118, 2834, 20063115, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", "青空の下で謁見", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2, 0, 8, 91002, "マホとの出会い", 40, 7, 10118, 2835, 20063115, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", "未来の騎空団\nマスコット？", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2, 0, 8, 91002, "アキノとの出会い", 40, 7, 10118, 2837, 20063115, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", "お嬢さまからの\n緊急依頼", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2, 0, 8, 91002, "ジュンとの出会い", 40, 18, 10118, 4108402, 20063115, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", "黄金色の悩みごと", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2, 0, 8, 91002, "カオリとの出会い", 40, 18, 10118, 4107402, 20063115, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", "白熱！　格闘大会！", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (2, 1, 8, 91002, "ニノンとの出会い", 40, 16, 10118, 9000227, 20063115, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", "祭り太鼓はオーエドの華", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (3, 0, 8, 91002, "スズナとの出会い", 40, 19, 10118, 2101181, 20063115, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", "人気者は遅れて\nやってくる", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (3, 0, 8, 91002, "ナナカとの出会い", 40, 18, 10118, 4109402, 20063115, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", "巫女・ミーツ・魔法少女", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (3, 0, 8, 91002, "キャル＆コッコロとの出会い", 40, 18, 10118, 4305402, 20063115, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", "ネズ耳は二度なくなる", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (3, 0, 8, 91002, "ユカリとの出会い", 40, 18, 10118, 4101402, 20063115, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", "この出会いにカンパイ！", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (3, 0, 8, 91002, "アオイとの出会い", 40, 18, 10118, 4106402, 20063115, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", "陰陽アンサンブル", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (3, 1, 8, 91002, "シノブとの出会い", 40, 7, 10118, 2836, 20063115, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", "運試し十番勝負！", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (1, 0, 0, 0, "オープニング", 0, 0, 10118, 0, 20063115, 5118600, 0, 0, "彼女たちの新たな日常", 0);
